<style>
    @import url('https://fonts.googleapis.com/css2?family=Manrope:wght@200..800&family=Tenor+Sans&display=swap');

    * {
        margin: 0;
        padding: 0;
    }

    body {
        overflow-x: hidden;
        overflow-y: hidden;
        background-color: #ebeff3;
    }

    #name {
        position: absolute;
        font-family: "Tenor Sans", sans-serif;
        font-weight: 400;
        font-style: normal;
        color: #29588b;
        background-color: #ebeff3;
        width: fit-content;
        opacity: 0;
        border-radius: 5px;
        border: 2px solid #29588b;
        padding: 0px 5px;
        font-size: 1rem;

    }
    svg path {
        cursor: pointer;
    }

    .county {
    fill: white;
    stroke: #6e7b92;
    stroke-width: .18px;
    transition: fill 0.6s ease-in-out;
    }

    .state-border {
        fill: none;
        stroke: #221e1f;
        stroke-width: .89px;
      }

    .county {
    fill: white;
    stroke: #c9c9c9;
    stroke-width: .18px;
    transition: fill 0.6s ease-in-out;
    }

    .county:hover {
        fill: #d7dee7;
        stroke: #6e7b92;
        transition: fill 0.3s ease-out;
    }

    /* This class will override the `county` class for elements that have both `county` and `covered` */
    .county.covered {
        fill: #29588b!important;
        stroke: #80A8D2;
        transition: fill 0.6s ease-in-out;
    }
    


    .county.covered:hover {
        fill: #3f8bdd !important;
        stroke: #80A8D2;
        transition: fill 0.6s ease-in-out;
    }

    


</style>

<script>
    document.querySelectorAll(".county").forEach(e => {
        
        e.addEventListener("mouseover", function () {
            window.onmousemove = function (j) {
                const x = j.clientX;
                const y = j.clientY;
                document.getElementById('name').style.top = y - 100 + 'px';
                document.getElementById('name').style.left = x + 10 + 'px';
            };

            document.getElementById("name").style.opacity = 1;
            document.getElementById("name-text").innerText = e.id;
        });

        e.addEventListener("mouseleave", function () {
            document.getElementById("name").style.opacity = 0;
        });

        e.addEventListener("click", function () {
            getUser(e.id);
        });
    });
</script>
